import React, { useState } from 'react';
import { Container, Row, Col, Card, Badge, Button } from 'react-bootstrap';
import './Projects.css';

const Projects = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      id: 1,
      title: 'SparkGrid',
      description: 'Developed a comprehensive dashboard for tracking and selling carbon credits. Implemented energy consumption prediction using machine learning, enabling users to download detailed reports in Excel format. Integrated blockchain technology for enhanced transparency in energy generation and consumption tracking. Designed and implemented secure authentication and authorization using JWT tokens.',
      image: 'https://via.placeholder.com/400x250/ff6b6b/ffffff?text=SparkGrid',
      technologies: ['ReactJS', 'NodeJS', 'Flask', 'Ethereum', 'MetaMask', 'scikit-learn', 'MongoDB', 'Tailwind CSS'],
      category: 'web',
      github: 'https://github.com/aditigarg1312/SparkGrid',
      live: '#',
      featured: true
    },
    {
      id: 2,
      title: 'Car Management Platform',
      description: 'Engineered a scalable backend using Node.js, Express.js, and MongoDB for efficient car management. Implemented role-based authentication and authorization for admins and clients. Optimized API request handling with Axios, improving request speed by 15%. Utilized Tailwind CSS for a modern, responsive, and maintainable UI design.',
      image: 'https://via.placeholder.com/400x250/4ecdc4/ffffff?text=Car+Management',
      technologies: ['ReactJS', 'NodeJS', 'ExpressJS', 'MongoDB', 'Tailwind CSS'],
      category: 'web',
      github: 'https://github.com/aditigarg1312/Car-Management-Platform',
      live: '#',
      featured: true
    },
  ];

  const filters = [
    { id: 'all', label: 'All Projects' },
    { id: 'web', label: 'Web Development' }
  ];

  const filteredProjects = activeFilter === 'all' 
    ? projects 
    : projects.filter(project => project.category === activeFilter);

  return (
    <div className="projects-section section">
      <Container>
        <h2 className="section-title">My Projects</h2>

        <div className="filter-container mb-5">
          <div className="filter-buttons">
            {filters.map(filter => (
              <Button
                key={filter.id}
                variant={activeFilter === filter.id ? 'primary' : 'outline-primary'}
                className={`filter-btn ${activeFilter === filter.id ? 'active' : ''}`}
                onClick={() => setActiveFilter(filter.id)}
              >
                {filter.label}
              </Button>
            ))}
          </div>
        </div>

        <Row>
          {filteredProjects.map((project, index) => (
            <Col lg={6} xl={4} className="mb-4" key={project.id}>
              <Card className={`project-card ${project.featured ? 'featured' : ''} animate-fade-in`}
                    style={{ animationDelay: `${index * 0.1}s` }}>
                <div className="project-image-container">
                  <Card.Img 
                    variant="top" 
                    src={project.image} 
                    className="project-image"
                  />
                  {project.featured && (
                    <div className="featured-badge">
                      <i className="fas fa-star"></i> Featured
                    </div>
                  )}
                  <div className="project-overlay">
                    <div className="project-links">
                      <a href={project.github} target="_blank" rel="noopener noreferrer" className="project-link">
                        <i className="fab fa-github"></i>
                      </a>
                      <a href={project.live} target="_blank" rel="noopener noreferrer" className="project-link">
                        <i className="fas fa-external-link-alt"></i>
                      </a>
                    </div>
                  </div>
                </div>

                <Card.Body className="project-body">
                  <Card.Title className="project-title">{project.title}</Card.Title>
                  <Card.Text className="project-description">
                    {project.description}
                  </Card.Text>

                  <div className="project-technologies">
                    {project.technologies.map((tech, techIndex) => (
                      <Badge 
                        key={techIndex} 
                        bg="secondary" 
                        className="tech-badge"
                      >
                        {tech}
                      </Badge>
                    ))}
                  </div>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>

        <Row className="mt-5">
          <Col lg={12} className="text-center">
            <div className="cta-section">
              <h3>Interested in working together?</h3>
              <p>Let's discuss your next project and bring your ideas to life!</p>
              <Button as="a" href="/contact" className="btn-custom">
                Get In Touch
              </Button>
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Projects;
